tables.table_schema:
CREATE TABLE LeadershipMetrics (
  id INT PRIMARY KEY,
  leader_name VARCHAR(100),
  metric_type VARCHAR(50),
  metric_value FLOAT
);

CREATE TABLE LeadershipFeedback (
  id INT PRIMARY KEY,
  leader_name VARCHAR(100),
  feedback_description TEXT,
  feedback_date DATE
);

CREATE TABLE LeadershipEffectivenessMetrics (
    employee_id UUID PRIMARY KEY,
    leadership_rating INT,
    communication_rating INT,
    motivation_rating INT
);

CREATE TABLE PerformanceReviewComments (
    review_id UUID PRIMARY KEY,
    employee_id UUID,
    reviewer_id UUID,
    review_comment TEXT
);

CREATE TABLE TeamEngagementScores (
    team_id UUID PRIMARY KEY,
    engagement_score INT
);

CREATE TABLE LeadershipFeedback (
    feedback_id INT PRIMARY KEY,
    leader_id INT,
    feedback_text TEXT,
    feedback_date DATE
);

CREATE TABLE LeadershipComments (
    comment_id INT PRIMARY KEY,
    leader_id INT,
    comment_text TEXT,
    comment_date DATE
);
